    false,nt"url": null,nt"notes": "This narrative report for Ortonville Wetland
    Management District outlines Refuge accomplishments during the 1977 calendar year.
    The report begins with an introduction to the Refuge and information about climatic
    and habitat conditions, land acquisition, and the system status. Construction, maintenance,
    and wildfires are also described. Habitat management is covered; croplands, grasslands,
    wetlands, forests, wilderness, and easements for waterfowl management are discussed.
    The wildlife section of the report discusses migratory birds, mammals, and non-migratory
    birds. Interpretation and recreation activities are outlined; topics include information
    and interpretation, recreation, and law enforcement. Field investigations, cooperative
    programs, items of interest, and safety information are discussed. Photographs are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
